import * as S from "./styles";

const Footer = () => {
  return (
    <S.Footer>
      \<button>Contact me</button>
      <div>
        <img src="/images/facebook.png"></img>
        <img src="/images/insta.png"></img>
        <img src="/images/git.png"></img>
      </div>
      <img src="/images/blue.png" className="blue"></img>
    </S.Footer>
  );
};

export default Footer;
